import { connect } from "react-redux"

const LeaderBoard = () => {
    return (
        <div>
            <table>
                <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Age</th>
                <th>Email</th>
                </tr>
            </table>
        </div>
    )
}
export default connect()(LeaderBoard)
